import React from 'react';
import {useState,useEffect} from 'react';
import axios from 'axios';
import Total from '../scenes/analytics/Total';

const Totalscoreacard = () => {

  const [data1, setData1] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const url = 'http://localhost:3001/getSingleData';
        const response = await axios.get(url);
        const data = response.data;
        console.log("testshare", data);
        setData1(data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);







  return (


    <div className="d-flex">
      {

   <>
      <div className="rounded bg-white p-3" style={{ flex: '1', marginRight: '1rem' }}>
        <div className="text">
          <p>
            Your Attempt <span>80</span>
          </p>
          <p>
            Attempted On <span>2023/04/30</span>
          </p>
          <p>
            Time Taken <span>45m</span>
          </p>
          <p>
            Bank <span>1/5</span>
          </p>
          <p>
            Correct <span>30%</span>
          </p>
          <p>
            Marks Obtained <span>68.00/80</span>
          </p>
          <p>
            Shipped <span></span>
          </p>
          <p>
            Time Taken <span>46m</span>
          </p>
          <p>
            Correct Questions <span>36</span>
          </p>
          <p>
            Incorrect Questions <span></span>
          </p>
          <p>
            Skipped Question <span></span>
          </p>
        </div>
      </div>
      <div className="Agraph" style={{ flex: '2', marginLeft: '1rem' }}>
        {<Total />}
      </div>
      </>
}
    </div>
  );
};

export default Totalscoreacard;
